I’m so excited to share that I am an #Entreprenista100 award winner! 🏆💓

The @entreprenista100 Awards were created to honor and recognize women within the women-led entrepreneurial community who have preserved through unimaginable odds and achieved remarkable success. 🎉

Love Social Media was recognized as a Top Agency & Service-based Business. Such a great way to celebrate 6 years in business!🥂

This year’s selection had the distinction of being judged by leading female founders and entrepreneurs.
@awilkiswilson: GlamSquad
