👶🏻 Mommin’ ain’t easy & neither is entrepreneurship - but it doesn’t mean you have to choose 💁‍♀️

Haven’t you heard?

@katielovesocial runs Love Social Media Agency and @kimrittberg helps professionals become thought leaders through video and podcasts. DM Kim about her July Video Boot Camp Intensive!

@katielovesocial joined @moms_exit_interview_ and shares how sexism forced her to leave TV news, the conversation that went into having her husband be a stay-at-home dad, and how she launched her own (now 7-figure) social media business. Plus she drops some amazing tips to grow your business on social media! 

@kimrittberg quit corporate after she was working in the labor and delivery room as a media exec. She hosts Mom’s Exit Interview to help parents find careers that work for them instead of the other way around!

💗 And we obviously had to wear pink!

